import "bootstrap/dist/css/bootstrap.css";
import React, { Component } from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";

import Login  from "../components/login"
import Header from "../components/header";
import Burger from "../components/burger";
import Section from "../components/section";
import Screen from "../components/screen"
import logo from "./MYtineraryLogo.png"
import Visit from "../components/visit"
import Carousel from 'react-images';
import styled from 'styled-components';
import "../App.css";

const Greeting = styled.div`
    display: block;
    margin-left: auto;
    margin-right: auto;
    width: 50%;
    text-align: center;
    font-size: 160%;
}
`;


class LandingPage extends Component {
  constructor(props) {
    super(props);
    this.New_York_view = 
    [{ url: "https://upload.wikimedia.org/wikipedia/commons/thumb/d/d3/Statue_of_Liberty%2C_NY.jpg/330px-Statue_of_Liberty%2C_NY.jpg", 
       url: "https://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/Edificio_Fuller_%28Flatiron%29_en_2010_desde_el_Empire_State_crop_boxin.jpg/225px-Edificio_Fuller_%28Flatiron%29_en_2010_desde_el_Empire_State_crop_boxin.jpg",
       irl: "https://upload.wikimedia.org/wikipedia/commons/thumb/c/c7/Empire_State_Building_from_the_Top_of_the_Rock.jpg/225px-Empire_State_Building_from_the_Top_of_the_Rock.jpg",
       url: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a1/Empire_State_Building_day.jpg/330px-Empire_State_Building_day.jpg",
       url: "https://upload.wikimedia.org/wikipedia/commons/thumb/1/1e/BOA_Tower_Feb_2010.jpg/255px-BOA_Tower_Feb_2010.jpg"
    }]
  }

  createUrls(inp){
    let urls = []; 
    inp.map(l => urls.push({src: l.url}))

    console.log(urls)
    return urls;
  }


  render() {
    return (
          <div>
          <Greeting>
              <p>Find your perfect trip, designed by insiders who know and love their
              cities.</p>
              <Visit></Visit>
          </Greeting>
          <p>Barcelona: Gaudi in a Day</p>
          <Carousel  className="infoText" views="{this.createUrls(this.New_York_view)}"/>
          <p>New York: Brooklin Pizza</p>
          <Carousel  className="infoText" views="{this.createUrls(this.New_York_view)}"/>
          <p>Amsterdam: Red Light Green Light</p>
          <Carousel  className="infoText" views="{this.createUrls(this.New_York_view)}"/>
          <p>Paris Champange at the Eifel</p>
          <Carousel  className="infoText" views="{this.createUrls(this.New_York_view)}"/>
          </div>
    )
  }
}
export default LandingPage;


